  input: TEXT,F3A,,"The following contributions were inadvertently entered on both
    the July 15 2003 quarterly report and the October 15 2003 quarterly report.  These
    contributions were received and reported correctly for the July 15 2003 quarterly
    reporting cycle.  The following contributions have been deleted, as amended, on
    the October 15 2003 quarterly report.  July 3, 2003 - Charlie Fagan 500, International
    Paper PAC 500, AFLAC PAC 1000, Mark McDaniel 1000.  On July 7, 2003 - E Berton
    Spence 100, Nicolette Mayer 1000, Robert Gardner 30.  On July 8, 2003 - American
    Optometric Assn PAC 1000, GP Employees Fund 1000, Principles Exalt a Nation PAC
    500.  The above-mentioned funds were never received by the committee of Mike Rogers
    for Congress during the reporting cycle for the October 15 2003 quarterly report.  We
    are amending the October 15 2003 quarterly report and all subsequent reports effected
    to ensure all election cycle amounts are correct."
